import React from "react";
import NavBar from "@components/navBar"
import { observer, inject } from "mobx-react"
import { useHistory } from "react-router-dom";
import { List, Button } from "antd-mobile";
import './style.scss'
const Home = (props: any) => {
 const { push } = useHistory();
 const { homeState } = props;
 return (
  <div className="my-wrap">
   <div className="my-top">
    <img src="https://zos.alipayobjects.com/rmsportal/hqQWgTXdrlmVVYi.jpeg" alt="" />
    <p>
     <span>我是前端!我是前端!</span>
     <span>圈子号: 12345576</span>
    </p>
   </div>
   <List className="my-list">
    <List.Item arrow="horizontal" onClick={() => push("/block")}>通知</List.Item>
    <List.Item arrow="horizontal" onClick={() => push("/changePwd")}>拉黑</List.Item>
    <List.Item arrow="horizontal" onClick={() => push("/changePwd")}>投诉</List.Item>
    <Button style={{color:'#16ac15'}} icon={<i className="iconfont icon-liaotian_jihuo" style={{fontSize:'22px',color:'#16ac15'}}></i>}>发消息</Button>
    <Button style={{color:'#16ac15'}} icon={<i className="iconfont icon-liaotian_jihuo" style={{fontSize:'22px',color:'#16ac15'}}></i>}>加好友</Button>
   </List>
   <NavBar />
  </div>
 )
}
export default inject('homeState')((observer(Home)));
